#include <vector>
#include <climits>

using namespace std;

class Solution {
public:
    int jump(vector<int>& nums) {
    	int start=0,end=0,maxend=0;
        int n=nums.size();
        int jumps=0;
        while(end<n-1)
        {
            maxend=end+1;
            jumps++;
            for(int i=start;i<=end;i++)
            {
                if(nums[i] + i >= n-1)
                    return jumps;
                maxend=max(maxend,nums[i]+i);
            }
            start=end+1;
            end=maxend;
        }

        return jumps;
        
    }

    

};

